import React from 'react'; 

class Clock extends React.Component {
    render() {
        return (
            <h1 className="heading">
            <span className="text"> Hello - 
            {new Date().toLocaleTimeString()}
            </span>

        </h1>
        )
    }
}

export default Clock;
